package in.gov.abdm.abha.enrollment.utilities.rsa;

import in.gov.abdm.abha.enrollment.utilities.rsa.RSAUtil;
import org.junit.Assert;
import org.junit.jupiter.api.AfterEach;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.extension.ExtendWith;
import org.mockito.InjectMocks;
import org.mockito.MockitoAnnotations;
import org.springframework.test.context.junit.jupiter.SpringExtension;
import org.springframework.test.util.ReflectionTestUtils;

import java.security.PrivateKey;

@ExtendWith(SpringExtension.class)
public class RSAUtilTests {
    @InjectMocks
    RSAUtil rsaUtil;

    @BeforeEach
    void setup(){
        MockitoAnnotations.openMocks(this);
        rsaUtil=new RSAUtil();
        ReflectionTestUtils.setField(rsaUtil,"encryptionAlgorithm","RSA/ECB/PKCS1Padding");
        ReflectionTestUtils.setField(rsaUtil,"rsaEncryptionAlgo","RSA");
        ReflectionTestUtils.setField(rsaUtil,"privateKeyContent","");
        ReflectionTestUtils.setField(rsaUtil,"publicKeyContent","");
    }
    @AfterEach
    void tearDown(){

    }
    @Test
    public void encryptTest(){
        //String s = "";
        String response= rsaUtil.encrypt("RSA/ECB/PKCS1Padding");
        Assert.assertEquals(true,response.isEmpty());

    }
    @Test
    public void decrypttTest(){
        String response= rsaUtil.decrypt("RSA/ECB/PKCS1Padding");
        Assert.assertEquals("",response);

    }
    @Test
    public void decrypttTest2(){
        String response= rsaUtil.decrypt("");
        Assert.assertEquals("",response);
    }
    @Test
    public void encryptTestNoSuchAlgorithmException(){
        ReflectionTestUtils.setField(rsaUtil,"rsaEncryptionAlgo","abc");
        ReflectionTestUtils.setField(rsaUtil,"publicKeyContent","");
        String response= rsaUtil.encrypt("RSA/ECB/PKCS1Padding");
    }
    @Test
    public void encryptTestInvalidKeySpecException(){
        ReflectionTestUtils.setField(rsaUtil,"publicKeyContent","");
        String response= rsaUtil.encrypt("RSA/ECB/PKCS1Padding");
    }
    @Test
    public void decryptTestNoSuchAlgorithmException(){
        ReflectionTestUtils.setField(rsaUtil,"rsaEncryptionAlgo","abc");
        String response= rsaUtil.decrypt("RSA/ECB/PKCS1Padding");
    }
    @Test
    public void decryptTestInvalidKeySpecException(){
        ReflectionTestUtils.setField(rsaUtil,"privateKeyContent","");
        String response= rsaUtil.decrypt("RSA/ECB/PKCS1Padding");
    }
    @Test
    public void getJWTPrivateKeyTests(){
        ReflectionTestUtils.setField(rsaUtil,"privateKeyContent","");
        PrivateKey response= rsaUtil.getJWTPrivateKey();

    }
    @Test
    public void isRSAEncryptedTests(){
      Boolean res = rsaUtil.isRSAEncrypted("test");
      Assert.assertEquals(false,res);
    }
}
